import uniqid from 'uniqid'
const ProjectItems = [
    {id: uniqid(), name: 'Fresh Out', img: require('./images/phone-screen-template.jpg')},
    {id: uniqid(), name: 'Japan Landmark', img: require('./images/Landmark_Home.jpg')},
    {id: uniqid(), name: 'Memory Card', img: require('./images/Memory_Game.jpg')},
    // {id: uniqid(), name: 'Farm', img: require('./images/Fresh_Out_Title.jpg')},
]

export default ProjectItems;
